import styled from "styled-components";

export const Container = styled.div`
  section {
    display: grid;
    grid-template-columns: repeat(5, 1fr);
    grid-gap: 8px;
  }
`;


export const H = styled.h1`
position: relative;
height: 100px;
font-size: 30px;
font-weight: 700;
background: grey;
display: flex;
align-items: center;
justify-content: left;
color: white;
`;
